import React, { useEffect, useState } from "react";
import EmployeeService from "../services/EmployeeService";
import { Link, useNavigate, useParams } from "react-router-dom";

export const UpdateEmployeeComponent = () => {
  const [firstName, setFirstName] = useState("");
  const [middleName, setMiddleName] = useState("");
  const [lastName, setLastName] = useState("");
  const [locationCity, setLocationCity] = useState("");
  const [address, setAddress] = useState("");
  const [dateBirth, setDateBirth] = useState("");
  const [telephone, setTelephone] = useState("");
  const [status, setStatus] = useState("");
  const [positionTitle, setPositionTitle] = useState("");
  const [hireDate, setHireDate] = useState("");
  const [email, setEmail] = useState("");
  const [salary, setSalary] = useState("");
  const [timeInPosition, setTimeInPostion] = useState("");

  const navigate = useNavigate();
  const { id } = useParams();

  useEffect(() => {
    EmployeeService.getEmployeeById(id)
      .then((response) => {
        setFirstName(response.data.firstName);
        setMiddleName(response.data.middleName);
        setLastName(response.data.lastName);
        setLocationCity(response.data.locationCity);
        setAddress(response.data.address);
        setDateBirth(response.data.dateBirth);
        setTelephone(response.data.telephone);
        setStatus(response.data.status);
        setPositionTitle(response.data.positionTitle);
        setHireDate(response.data.hireDate);
        setEmail(response.data.email);
        setSalary(response.data.salary);
        setTimeInPostion(response.data.timeInPosition);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  const changeFirstNameHandler = (event) => {
    setFirstName(event.target.value);
  };

  const changeMiddleNameHandler = (event) => {
    setMiddleName(event.target.value);
  };

  const changeLastNameHandler = (event) => {
    setLastName(event.target.value);
  };

  const changeLocationCityHandler = (event) => {
    setLocationCity(event.target.value);
  };

  const changeAddressHandler = (event) => {
    setAddress(event.target.value);
  };

  const changeDateBirthHandler = (event) => {
    setDateBirth(event.target.value);
  };

  const changeTelephoneHandler = (event) => {
    setTelephone(event.target.value);
  };

  const changePositionHandler = (event) => {
    setPositionTitle(event.target.value);
  };

  const changeDateArrivalHandler = (event) => {
    setHireDate(event.target.value);
  };

  const changeEmailHandler = (event) => {
    setEmail(event.target.value);
  };

  const changeSalaryHandler = (event) => {
    setSalary(event.target.value);
  };

  const changeTimeSalaryHandler = (event) => {
    setTimeInPostion(event.target.value);
  };

  const changeStatusHandler = (event) => {
    setStatus(event.target.value);
  };

  const saveEmployee = (e) => {
    e.preventDefault();
    let employee = {
      hireDate: hireDate,
      positionTitle: positionTitle,
      email: email,
      salary: salary,
      timeSalary: timeInPosition,
      state: status,
      idEmployee: {
        firstName: firstName,
        middleName: middleName,
        lastname: lastName,
        locationCity: locationCity,
        address: address,
        dateBirth: dateBirth,
        telephone: telephone,
      },
    };
    console.log("employee => " + JSON.stringify(employee));

    EmployeeService.createEmployee(employee).then((res) => {
      navigate("/employee");
    });
  };

  return (
    <div className="container">
      <div className="row">
        <div className="card col-md-6 offset-md-3 offset-md-3">
          <h3 className="text-center">Employee Form</h3>
          <div className="card-body">
            <form>
              <h5 className="text-center">Employee Data</h5>
              <div className="form-group">
                <label>First Name:</label>
                <input
                  placeholder="First Name"
                  name="firstName"
                  className="form-control"
                  value={firstName}
                  onChange={changeFirstNameHandler}
                />
              </div>
              <div className="form-group">
                <label>Middle Name:</label>
                <input
                  placeholder="Middle Name"
                  name="middleName"
                  className="form-control"
                  value={middleName}
                  onChange={changeMiddleNameHandler}
                />
              </div>
              <div className="form-group">
                <label>Last Name:</label>
                <input
                  placeholder="Last Name"
                  name="lastName"
                  className="form-control"
                  value={lastName}
                  onChange={changeLastNameHandler}
                />
              </div>
              <div className="form-group">
                <label>Location City:</label>
                <input
                  placeholder="Location City"
                  name="locationCity"
                  className="form-control"
                  value={locationCity}
                  onChange={changeLocationCityHandler}
                />
              </div>
              <div className="form-group">
                <label>Address:</label>
                <input
                  placeholder="Address"
                  name="address"
                  className="form-control"
                  value={address}
                  onChange={changeAddressHandler}
                />
              </div>
              <div className="form-group">
                <label>Date Birth:</label>
                <input
                  placeholder="Date Birth"
                  name="dateBirth"
                  className="form-control"
                  value={dateBirth}
                  onChange={changeDateBirthHandler}
                />
              </div>
              <div className="form-group">
                <label>Telephone:</label>
                <input
                  placeholder="Telephone"
                  name="telephone"
                  className="form-control"
                  value={telephone}
                  onChange={changeTelephoneHandler}
                />
              </div>

              <h5 className="text-center">Position Data</h5>
              <div className="form-group">
                <label>Position:</label>
                <input
                  placeholder="Position"
                  name="position"
                  className="form-control"
                  value={positionTitle}
                  onChange={changePositionHandler}
                />
              </div>
              <div className="form-group">
                <label>Date Arrival:</label>
                <input
                  placeholder="Date Arrival"
                  name="dateArrival"
                  className="form-control"
                  value={hireDate}
                  onChange={changeDateArrivalHandler}
                />
              </div>
              <div className="form-group">
                <label>Email:</label>
                <input
                  placeholder="Email"
                  name="email"
                  className="form-control"
                  value={email}
                  onChange={changeEmailHandler}
                />
              </div>
              <div className="form-group">
                <label>Salary:</label>
                <input
                  placeholder="Salary"
                  name="salary"
                  className="form-control"
                  value={salary}
                  onChange={changeSalaryHandler}
                />
              </div>
              <div className="form-group">
                <label>Time Salary:</label>
                <input
                  placeholder="Time Salary"
                  name="timeSalary"
                  className="form-control"
                  value={timeInPosition}
                  onChange={changeTimeSalaryHandler}
                />
              </div>
              <div className="form-group">
                <label>Status:</label>
                <input
                  placeholder="Status"
                  name="status"
                  className="form-control"
                  value={status}
                  onChange={changeStatusHandler}
                />
              </div>
              <button className="btn btn-success" onClick={saveEmployee}>
                Save
              </button>
              <Link to="/employee" className="btn btn-danger">
                Cancel
              </Link>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UpdateEmployeeComponent;
